!function(){"use strict"
angular.module("animateApp").controller("socialLoginCtrl",["$scope","$auth",function(t,o){t.fb_button=!0,t.google_button=!0,t.logout_button=!1,t.authenticate=function(n){o.authenticate(n).then(function(o){"undefined"!=typeof o.data.token?(t.fb_button=!1,t.google_button=!1,t.logout_button=!0):alert("Facebook Login error")},function(t){alert("Facebook Login error")})},t.logOut=function(){o.logout(),t.fb_button=!0,t.google_button=!0,t.logout_button=!1}}])}()
